pub type Card = u8;

use rand::Rng;
pub fn gen_cards<R: Rng>(rng: &mut R, count: usize) -> Vec<Card> {
    let mut cards = Vec::with_capacity(count);
    for _ in 0..count {
        cards.push(gen_card(rng));
    }
    cards
}

pub fn gen_card<R: Rng>(rng: &mut R) -> Card {
    rng.gen_range(0, DECK_SIZE)
}

pub fn get_card_string(card: Card) -> String {
    format!("{} of {}", get_rank_str(card), get_suit_str(get_suit(card)))
}

pub fn get_card_list(cards: &[Card]) -> String {
    //TODO better size estimate.
    let mut output = String::with_capacity(cards.len() * 20);
    let len = cards.len();
    let mut sep = "";
    for (i, &card) in cards.iter().enumerate() {
        output.push_str(sep);
        output.push_str(&get_card_string(card));

        if i >= len.saturating_sub(2) {
            sep = ", and ";
        } else {
            sep = ", ";
        }
    }
    output
}

pub const RANK_SUIT_PAIR_WITH_IN_CHARS: u8 = 4;

pub fn get_suit_rank_pair(card: Card) -> String {
    let mut output = String::with_capacity(RANK_SUIT_PAIR_WITH_IN_CHARS as usize);

    let (colour, suit_char) = get_suit_colour_and_char(get_suit(card));

    output.push(RANK_SUIT_PAIR_LAYOUT_CHAR as char);
    output.push(get_rank_char(card) as char);
    output.push(suit_char as char);
    output.push(colour as char);

    output
}

pub fn get_suit_rank_pair_list(cards: &[Card]) -> String {
    //TODO better size estimate.
    let mut output = String::with_capacity(cards.len() * RANK_SUIT_PAIR_WITH_IN_CHARS as usize * 2);
    let len = cards.len();
    let mut sep = "";
    for (i, &card) in cards.iter().enumerate() {
        output.push_str(sep);
        output.push_str(&get_suit_rank_pair(card));

        if i >= len.saturating_sub(2) {
            sep = ", and ";
        } else {
            sep = ", ";
        }
    }
    output
}

#[cfg(test)]
mod tests {
    use super::*;
    use quickcheck::*;

    #[test]
    fn test_get_suit_rank_pair_list_retains_layout_char() {
        let v = vec![9];
        let list = get_suit_rank_pair_list(&v);
        assert!(list.contains(RANK_SUIT_PAIR_LAYOUT_CHAR as char));
        assert!(list.as_bytes().contains(&RANK_SUIT_PAIR_LAYOUT_CHAR));

        let s = format!("{:?}", list.as_bytes());
        assert!(s.contains(&RANK_SUIT_PAIR_LAYOUT_CHAR.to_string()));
        assert_eq!(s, "[26, 27, 31, 7]");
    }
}

pub fn get_short_card_string_and_colour(card: Card) -> (String, u8) {
    let (colour, ch) = get_suit_colour_and_char(get_suit(card));

    let mut output = String::with_capacity(2);

    output.push(get_rank_char(card) as char);
    output.push(ch as char);

    (output, colour)
}

